def void printExamResult(boolean isPassed,String grade){
if(isPassed== true)
{
	log.info 'Congrats'
printGradeMessage(grade)
}
else{
	log.error 'Better luck next time'
}

}

def void printGradeMessage(String grade){

if(grade=='A')
{
log.info 'Car'	
}
else if(grade=='B')
{
log.info 'Bike'	
}
else{
	log.info 'You got nothing'
}
}
